import React from 'react';
import './Popular.css';
import data_product from '../Assets/data'; // Verifique se o caminho está correto

// Componente para representar cada item de produto
const ProductItem = ({ id, name, image, new_price, old_price }) => {
  return (
    <div className="product-item" key={id}>
      <img src={image} alt={name} />
      <h2>{name}</h2>
      <p>New Price: ${new_price}</p>
      {old_price && <p>Old Price: <s>${old_price}</s></p>}
    </div>
  );
};

const Popular = () => {
  return (
    <div className="popular">
      <h1>POPULAR IN TENIS</h1>
      <hr />
      <div className="popular-item-container">
        {data_product.map((item, i) => (
          <ProductItem
            key={i}
            id={item.id}
            name={item.name}
            image={item.image}
            new_price={item.new_price}
            old_price={item.old_price}
          />
        ))}
      </div>
    </div>
  );
};

export default Popular;
